CREATE DEFINER=`root`@`localhost` PROCEDURE `grabar_um` (`v_pry` INT, `v_ae` INT, `v_eje` INT, `v_id` INT, `v_des` VARCHAR(250), `v_ene` DOUBLE, `v_feb` DOUBLE, `v_mar` DOUBLE, `v_abr` DOUBLE, `v_may` DOUBLE, `v_jun` DOUBLE, `v_jul` DOUBLE, `v_ago` DOUBLE, `v_sep` DOUBLE, `v_oct` DOUBLE, `v_nov` DOUBLE, `v_dic` DOUBLE, `v_users` VARCHAR(8), `v_ip` VARCHAR(20))  BEGIN
        DECLARE    v_total double;
        DECLARE    v_id_generado int(8);
        DECLARE    v_mensaje varchar(70);
        DECLARE    v_valor bool;
        
        SET v_total =  (v_ene + v_feb + v_mar + v_abr + v_may + v_jun + v_jul + v_ago + v_sep + v_oct + v_nov + v_dic);


        IF EXISTS(SELECT id_um FROM safor_pry_ae_eje_um WHERE id_um=v_id AND id_eje=v_eje) THEN
             UPDATE safor_pry_ae_eje_um
                        set ene_ren=v_ene, feb_ren=v_feb, mar_ren=v_mar, abr_ren=v_abr, may_ren=v_may, jun_ren=v_jun, jul_ren=v_jul, ago_ren=v_ago, sep_ren=v_sep, oct_ren=v_oct, nov_ren=v_nov, dic_ren=v_dic, total_ren=v_total, rindio=1
                WHERE id_um=v_id AND id_eje=v_eje;

             SET v_id_generado= v_id;
             SET v_mensaje='La unidad de medida se rindio exitosamente';
             SET v_valor=true;
        END IF;

        IF NOT EXISTS(SELECT rindio FROM safor_pry_ae_eje_um WHERE id_ae=v_ae AND id_eje=v_eje AND rindio=0) THEN
              IF NOT EXISTS(SELECT rindio FROM safor_pry_ae_ai_eje_um WHERE id_ae=v_ae AND id_eje=v_eje AND rindio=0) THEN
                      UPDATE safor_ae SET rindio=1
                        WHERE id_ae=v_ae AND id_eje=v_eje;

                     SET v_id_generado= v_id;
                     SET v_mensaje='La unidad de medida y la accion especifica se rindieron exitosamente';
                     SET v_valor=true;
              END IF;
        END IF;

                VALUES (v_users, v_ip, v_mensaje, v_id_generado, v_eje);

        select  v_id_generado as id,v_mensaje as mensaje,v_valor as valor;
END$$

